      client->sendTextMessage(" Now we call the compression engine itself, deflate(). It takes as many of the avail_in bytes at next_in as it can process, and writes as many as avail_out bytes to next_out. Those counters and pointers are then updated past the input data consumed and the output data written. It is the amount of output space available that may limit how much input is consumed. Hence the inner loop to make sure that all of the input is consumed by providing more output space each time. Since avail_in and next_in are updated by deflate(), we don't have to mess with those between deflate() calls until it's all used up. The parameters to deflate() are a pointer to the strm structure containing the input and output information and the internal compression engine state, and a parameter indicating whether and how to flush data to the output. Normally deflate will consume several K bytes of input data before producing any output (except for the header), in order to accumulate statistics on the data for optimum compression. It will then put out a burst of compressed data, and proceed to consume more input before the next burst. Eventually, deflate() must be told to terminate the stream, complete the compression with provided input data, and write out the trailer check value. deflate() will continue to compress normally as long as the flush parameter is Z_NO_FLUSH. Once the Z_FINISH parameter is provided, deflate() will begin to complete the compressed output stream. However depending on how much output space is provided, deflate() may have to be called several times until it has provided the complete compressed stream, even after it has consumed all of the input. The flush parameter must continue to be Z_FINISH for those subsequent calls. o offer use of a PMCE, a client includes aSec-WebSocket-Extensions header element with the extension name ofthe PMCE in the Sec-WebSocket-Extensions header in the client'sopening handshake of the WebSocket connection.  Extension parametersin the element represent the PMCE offer in detail.  For example, aclient lists preferred configuration parameter values for thecompression algorithm of the PMCE.  A client offers multiple PMCEchoices to the server by including multiple elements in theSec-WebSocket-Extensions header, one for each PMCE offered.  Theset of elements MAY include multiple PMCEs with the same extensionname to offer use of the same algorithm with different configurationparameters.  The order of elements means the client's preference.  Anelement precedes another element has higher preference.  It isRECOMMENDED that a server accepts PMCEs with higher preference if theserver supports it.A PMCE negotiation offer informs requests and/or hints to the server.A request in a PMCE negotiation offer indicates constraints on theserver's behavior that must be satisfied if the server accepts theoffer.  A hint in a PMCE negotiation offer indicates informationabout the client's behavior that the server may either safely ignoreor refer to when the server decides its behavior.To accept use of an offered PMCE, a server includes aSec-WebSocket-Extensions header element with the extension name ofthe PMCE in the Sec-WebSocket-Extensions header in the server'sopening handshake of the WebSocket connection.  Extension parametersin the element represent the configuration parameters of the PMCE touse in detail.  We call these extension parameters and their valuesagreed parameters.  The element MUST represent a PMCE that is fullysupported by the server.  The contents of the element doesn't need tobe exactly the same as one of the received extension negotiationoffers.  For example, an extension negotiation offer with anextension parameter Xindicating availability of the feature X maybe accepted with an element without the extension parameter meaningthat the server declined use of the feature.Agreed parametersMUST represent how the requests and hints in theclient's extension negotiation offer have been handled in addition tothe server's requests and hints on the client's behavior, so that theclient can configure its behavior without identifying which PMCEextension negotiation offer has been accepted.For example, if a client sends an extension negotiation offerincluding a parameter enable_compression and another without theparameter, the server accepts the former by sending back an elementYoshino                   Expires July 26, 2014                 [Page 7]Internet-Draft    Compression Extensions for WebSocket      January 2014including a parameter that acknowledges enable_compression.  Thename of the acknowledging parameter doesn't need to be the same asthe offer.General negotiation flow will be like the followings.  How to handleparameters in detail will be specified in the specifications for eachPMCEs.A client makes an offer including parameters identifying thefollowings:o  Hints about how the client is planning to compress datao  Requests about how the server compresses datao  Limitation of the client's compression functionalityThe peer server uses these parameters, makes a determination of itsbehavior based on them if it can and wants to proceed with this PMCEenabled, and responds to the client with parameters identifying thefollowings:o  Requests about how the client compresses datao  How the server will compress dataThe client uses these parameters from the server make a determinationof its behavior based on them if it can and wants to proceed.Otherwise, the client starts closing handshake with close code 1010.There can be compression features that can be applied separately foreach direction.  For such features, the acknowledging parameter andthe parameter for the reverse direction must be chosen to bedistinguishable from each other.  For example, we can add server_prefix to parameters affecting data sent from a server andrefix to ones affecting data sent from a client to make themdistinguishable.A server MUST NOT accept a PMCE extension negotiation offer togetherwith another extension if the PMCE will conflict with the extensionon use of the RSV1 bit.  A client that receives a response acceptinga PMCE extension negotiation offer together with such an extensionMUST _Fail the WebSocket Connection_.A server MUST NOT accept a PMCE extension negotiation offer togetherwith another extension if the PMCE will be applied to output of theextension and any of the following conditions applies to theextension:Yoshino                   Expires July 26, 2014                 [Page 8]Internet-Draft    Compression Extensions for WebSocket      January 2014o  The extension requires boundary of fragments to be preservedbetween output from the extension at the sender and input to theextension at the receiver.o  The extension uses the Extension data field or any of thereserved bits on the WebSocket header as per-frame attribute.A client receiving a response accepting a PMCE extension negotiationoffer together with such an extension MUST _Fail the WebSocketConnection_.A server declines all offered PMCEs by not including any element withPMCE names.  If a server responds with no PMCE element in theSec-WebSocket-Extensions header, both endpoints proceed withoutPer-message Compression once _the WebSocket Connection isestablished_.If a server gives an invalid response, such as accepting a PMCE thatthe client did not offer, the client MUST _Fail the WebSocketConnection_.If a server responds with a valid PMCE element in the ec-WebSocket-Extensions header and _the WebSocket Connection isestablished_, both endpoints MUST use the algorithm described inSection 6 to exchange messages, using the message payloadtransformation (compressing and decompressing) procedure of the PMCEreturned by the server."); //Apotropaic magicFrom Wikipedia, the free encyclopediaThe ancient blue and white Nazar boncuğu symbol, a stylised eye thought to avert the evil eye, appears on this Turkish Airlines airplaneApotropaic magic (from Greek apotrepein to ward off from apo- awayand trepein o turn) is a type of magic intended to turn away harm or evil influences, as in deflecting misfortune or averting the evil eye. Apotropaic observances may also be practiced out of vague superstition or out of tradition, as in good luck charm (perhaps some token on a charm bracelet), amulets, or gestures such as crossed fingers or knocking on wood. The Greeks made offerings to the averting gods (Ἀποτρόπαιοι θεοί: Apotropaioi Theoi), chthonic deities and heroes who grant safety and deflect evil.[1]Contents1 Symbols1.1 Egypt1.2 Ancient Greece1.3 Evil eye1.4 Grotesquerie1.5 Other2 Good luck tokens and charms3 See also4 References5 Further reading6 External linksSymbolsEgyptThis apotropaic wand shows a procession of protective deities. Such a wand would have been used in rituals associated with birth and were perhaps used to draw a magical circle around the mother and child. Walters Art Museum, Baltimore.Apotropaic magical rituals were practiced throughout the ancient Near East and Egypt. Fearsome deities were invoked via ritual in order to protect individuals by warding away evil spirits. In ancient Egypt, these household rituals (performed in the home, not in state-run temples) were embodied by the deity who personified magic itself, Heka.[2] The two gods most frequently invoked in these rituals were the hippopotamusiform fertility goddess, Taweret, and the lion-demon, Bes (who developed from the early apotropaic dwarf demon-god, Aha, literally meaning fighter).[3]Objects were often used in these rituals in order to facilitate communication with the gods. One of the most commonly found magical objects, the ivory apotropaic wand, gained widespread popularity in the Middle Kingdom (ca. 1550 - 1069 BCE).[4] These wands were used to protect expectant mothers and children from malevolent forces, and were adorned with processions of apotropaic solar deities. Likewise, protective amulets bearing the likenesses of gods and goddesses like Taweret were commonly worn. Water came to be used frequently in ritual as well, wherein libation vessels in the shape of Taweret were used to pour healing water over an individual. In much later periods (when Egypt came under the Greek Ptolemies), stele featuring the god Horus were used in similar rituals; water would be poured over the stele and—after ritually acquiring healing powers—was collected in a basin for an afflicted person to drink.Ancient GreeceThe Gorgon, flanked by lionesses and showing her belt clasp of serpents, as depicted at the west pediment of the 580 B.C. temple of Artemis in Corfu on display at the Archaeological Museum of Corfu.Chalcidian black-figured eye-cup, circa 530 BC. Staatliche Antikensammlungen.Among the Ancient Greeks the most widely used image intended to avert evil was that of the Gorgon, the head of which now may be called the Gorgoneion, which features wild eyes, fangs, and protruding tongue. The full figure of the Gorgon holds the apex of the oldest remaining Greek temple where she is flanked by two lionesses. The Gorgon head was mounted on the aegis and shield of Athena.[5]Evil eyeEyes were often painted to ward off the evil eye. An exaggerated apotropaic eye or a pair of eyes were painted on Greek drinking vessels called kylikes (eye-cups) from the 6th century BC. The exaggerated eyes may have prevented evil spirits from entering the mouth while drinking.[6][7] Fishing boats in some parts of the Mediterranean region still have stylised eyes painted on the bows. A Turkish budget airline, Fly Havayolu Taşımacılık A.Ş., had adopted the symbol (known as Nazar boncuğu or Nazar bonjuk) as a motif for the vertical stabilizer of its aeroplanes. The Yiddish expression, Kain ein horeh (קיין עין הרע) is apotropaic in nature, and literally translates to no evil eye somewhat equivalent to the expression, Knock on wood.GrotesquerieA 12th-century Sheela na Gig on the church at Kilpeck, HerefordshirePeople believed that the doorways and windows of buildings were particularly vulnerable to the entry or passage of evil. On churches and castles, gargoyles or other grotesque faces and figures such as sheela na gigs and hunky punks were carved to frighten away witches and other malign influences. Figures may also have been carved at fireplaces or chimneys; in some cases, simple geometric or letter carvings were used for these. When a wooden post was used to support a chimney opening, this was often an easier material for amateur carving. To discourage witchcraft, rowan wood may have been chosen for the post or mantel.[8]Similarly the grotesque faces carved into pumpkin lanterns (and their earlier counterparts, made from turnips, swedes or beets) at Halloween are meant to avert evil: this season was Samhain, the Celtic new year. As a time between times, it was believed to be a period when souls of the dead and other dangerous spirits walked the earth. Many European peoples had such associations with the period following the harvest in the fall. (See also: Celtic calendar)OtherMirrors and other shiny objects were believed to deflect the evil eye. Traditional English Plough Jags (performers of a regional variant of the mummers play) sometimes decorated their costumes (particularly their hats) with shiny items, to the extent of borrowing silver plate for the purpose. Witch balls are shiny blown glass ornaments, like Christmas baubles, that were hung in windows.Items and symbols such as crosses, crucifixes, silver bullets, wild roses and garlic were believed to ward off or destroy vampires.In Ireland and Great Britain, magpies are traditionally thought to bring bad luck. Many people repeated various rhymes or salutations to placate them.[9]Geto-Dacian apotropaic eyes motif on the Helmet of Iron Gates (4th century BC)In Ancient Greece, phalli were believed to have apotropaic qualities. Often stone reliefs would be placed above doorways, and three-dimensional versions were erected across the Greek world. Most notable of these were the urban monuments found on the island of Delos. Grotesque, satyr-like bearded faces, sometimes with the pointed cap of the workman, were carved over the doors of ovens and kilns, to protect the work from fire and mishap.[10]A similar use of phallic representations to ward off the evil eye remains popular in modern Bhutan; it is associated with the 500-year-old Buddhist tradition of Drukpa Kunley. It is paralleled by other south Asian uses of the lingam symbol.[11]Apotropaic marking on a farmhouse from Niemelä Tenant Farm, now exhibited at Seurasaari Open Air Museum in FinlandIn Roman art, apotropaic imagery was a common theme. Envy was thought to bring bad luck to the person envied. To avoid envy, Romans sought to incite laughter in their guests by using humorous images. Images such as large phalluses (see fascinum), deformities like hunchbacks, or non-Roman subjects such as pygmies and black Africans were common. Romans saw deformity as comical and believed that such images could be used to deflect the evil eye.[12]In Europe, apotropaic figureheads carved onto the prow of sailing ships are considered to have been a replacement for the sacrifice of a thrall during the Age of Invasions by Saxon and Viking sailors, to avoid bad luck on the voyage. Dredging of the Thames under London Bridge, led to the discovery of a large number of bent and broken knives, daggers, swords and coins, from the modern period and dating back to Celtic times. This custom seems to have been to avoid bad luck, particularly when setting off on a voyage. Similarly, the burial of an old boot or shoe by the lintel of the back door of a house, seems to have had a similar intention.Good luck tokens and charmsAmulets for specific purposes on sale at a Shinto shrine in JapanThe tree covered with Nazars against maleficeIt is difficult to differentiate between items supposed to avert evil and items intended to attract good fortune, but generally a talisman brings good luck[13] whereas an amulet wards off or protects against and is therefore apotropaic.In Western culture, a horseshoe was often nailed up over, or close by, doorways, normally with the ends pointing upwards; it is said to collect good luck, or to stop the luck from falling out (see Oakham's horseshoes). Model horseshoes (of card or plastic) are given as good-luck tokens, particularly at weddings, and small paper horseshoes feature in confetti.[citation needed]Irish Travelers and Roma often sell white heather to bring good luck (Sometimes white sea-lavender, a species of Limonium, is sold instead.)[citation needed]In Ireland, St Brigid's crosses, woven from rush, were kept indoors (in houses and animal houses) to keep away illness for the year.[citation needed]In some Native American cultures, a dreamcatcher made of yarn like a web is placed above a bed or sleeping area to protect sleeping children from nightmares.[citation needed]See alsoAnasyrmaExorcismGargoyleGorgoneionHamsaPainted pebblesPazuzuPeijainenRosaryMezuzahSheela na GigSinga (mythology)ReferencesGilleland, Michael; tr. Jones, W.H.S. (26 June 2008). Averers of Evil. Retrieved 3 July 2010. Hippocrates, Regimen 4.89: So with this knowledge about the heavenly bodies, precautions must be taken, with change of regimen and prayers to the gods; in the case of good signs, to the Sun, to Heavenly Zeus, to Zeus, Protector of Home, to Athena, Protectress of Home, to Hermes and to Apollo; in the case of adverse signs, to the Averters of evil [apotropaioi], to Earth and to the Heroes, that all dangers may be averted. Pausanias 2.11.1 (Corinth): Before the altar a barrow has been raised for Epopeus himself, and near the grave are the gods Averters of evil [apotropaioi]. Near them the Greeks perform such rites as they are wont to do in order to avert misfortunes. (πρὸ τοῦ βωμοῦ δὲ αὐτῷ μνῆμα Ἐπωπεῖ κέχωσται, καὶ τοῦ τάφου πλησίον εἰσὶν Ἀποτρόπαιοι θεοί: παρὰ τούτοις δρῶσιν ὅσα Ἕλληνες ἐς ἀποτροπὴν κακῶν νομίζουσιν.)Robert Ritner (1988). The Mechanics of Ancient Egyptian Magical Practice. Chicago: The Oriental Institute of Chicago, 14-28.James F. Romano (1978), The Origin of Aha (also called Bes). New York: College Art Association, 1978.Hartwig Atlenmüller (1965). Die Apotopaia und Die Götter Mittelägyptens. Munich: Ludwig-Maximilians University.Harrison, pp 196ff.Walter Leo Hildburgh (1946), Apotropaism in Greek vase-paintingsapotropaic eye (art). Encyclopedia Britannica. Retrieved 2014-03-22.Ayres, James (2003). Domestic interiors: the British tradition, 1500 - 1850. Yale University Press. p. 24. ISBN 0-300-08445-5.The children's TV series Magpie preserved these rhymes as its theme song into the 1970sHarrison, pp 187ff The Ker as Gorgon.Bhutan phalluses ward off evil. BBC News. 2005-03-25. Archived from the original on 13 December 2009. Retrieved 2010-01-01.John R. Clarke (2003), Art in the Lives of Ordinary RomansDictionary definitionFurther readingFrazer, Sir James, The Golden Bough,Graves, Robert, The White Goddess,Jane Ellen Harrison, Prolegomena to the Study of Greek ReligionRoud, Steve (2004). A Pocket Guide to Superstitions of the British Isles. London: Penguin. ISBN 0-14-051549-6.Wikimedia Commons has media related to Apotropaic symbols.External linksThe Golden Bough: on-line text, 1922 abridged editionSue Dewsbury, Folk Plays - January 2004 - Coleby Plough Jag, photos of Mummers, Traditional Drama Research GroupApotropaic protection at Kilbirnie Place castle keep North Ayrshire, Scotland.[hide]v t eSuperstitionsMain topicsAmulet Evil eye Luck Omen Talismans ReligionListsList of lucky symbols List of unlucky symbols Sailors superstitions Theatrical superstitionsAfricaBuda Gris-gris Sampy Sleeping childAmericasAscalapha odorata Carranca Curupira Djucu Fortune cookie InoGo tied Witch windowAsiaSouth AsiaSuperstition in Indialist Mumbai sweet seawater incident Superstition in Pakistan Bhoot (ghost) Chashme Baddoor Chhaupadi Churel Dhat syndrome Ghosts in Bengali culture Grease devil Hindu milk miracle Jackals horn